import React from "react";

const cardClub = (props) => {
  return (
    <div>
      <i alt="img-icon-club" url={props.fa}></i>
      <h2> {props.name}</h2>
      <ul> {props.members}</ul>
    </div>
  );
};

export default cardClub;
